"""
binarysearch.com :: Largest Sum of Non-Adjacent Numbers in Circular List
jramaswami
"""


class Solution:
    def solve(self, nums):
        # Boundary case: empty nums
        if not nums:
            return 0

        def solve0(nums0):
            dp = [0 for _ in nums0]
            dp[0] = max(dp[0], nums0[0])
            dp[1] = max(dp[0], nums0[1])
            for i in range(2, len(nums0)):
                dp[i] = max(
                    dp[i-2],
                    dp[i-3],
                    nums0[i] + dp[i-2],
                    nums0[i] + dp[i-3]
            )
            return max(dp)

        return max(solve0(nums[:-1]), solve0(nums[1:]))


